// CSS File
import "./App.css";
// Styled-styledComponents
import Styled from "styled-components";
function App() {
  const DivStyle = Styled.div`
    border: 5px solid black;
    width: 300px;
    height: 300px;
    padding: 5px 10px;
    margin: 20px auto;
    position: relative;
  `;
  const Circle = Styled.div`
  display: inline-block;
    background-color: yellow;
    width: 100px;
    height: 100px;
    border-radius: 50%;
    margin: 0 20px;
    &::before{
      content: "";
      position: absolute;
      bottom: 10px;
      left: 10px;
      width: 30px;
      height: 20px;
      background-color: red;
      color: white;
      cursor: pointer;
    }
  `;
  return (
    <DivStyle>
      <Circle />
      <Circle />
    </DivStyle>
  );
}

export default App;
